INSERT INTO `sys_api` VALUES ('610', '00000000023', '1', '成都印钞有限公司印钞产品总账', '99d1ed4c79', 'SELECT ? 名称,\'103-G-6T\' 纸张名称,\'XXX\' 纸张规格,\'35开\' 开数,\'尺\' 单位,\'数-钞-2-11\' 库房', 'product', '', '2019-07-18 14:06:02', '2019-07-18 16:25:03', '0');
