INSERT INTO `sys_api` VALUES ('794', '00000000003', '1', '票面实废分布图', '7f57462b6e', 'with cart_list as (select cart_number from qfm_wip_jobs where cart_number in (?)),fake_list as (SELECT 5 -     (convert_sheet_number - 1 - mod(convert_sheet_number - 1,                    (case                      when substr(a.cart_number,3,1) in (2,3) then                       8                      else                       7                     end))) / (case      when substr(a.cart_number,3,1) in (2,3) then       8      else       7     end) col_idx,    (case      when substr(a.cart_number,3,1) in (2,3) then       8      else       7     end) - mod(c.convert_sheet_number + (case            when substr(a.cart_number,3,1) in (2,3) then            8            else            7           end) - 1,          (case            when substr(a.cart_number,3,1) in (2,3) then            8            else            7           end)) row_idx,   substr(c.sheet_num,7,1) kilo_num,c.convert_sheet_number   FROM qfm_wip_jobs A  INNER JOIN qfm_qa_inspect_master b    ON A.job_id = b.job_id   AND A.cart_number in (select * from cart_list)  INNER JOIN qfm_qa_inspect_slave c    ON b.inspectm_id = c.inspectm_id   and c.image_blob IS NOT NULL) select  col_idx \"col\",row_idx \"row\",kilo_num \"kilo\",count(kilo_num) \"err_num\",convert_sheet_number \"format_pos\"  from fake_list  group by col_idx,row_idx,kilo_num,convert_sheet_number  order by 3,1,2', 'carts', '', '2020-01-06 11:23:17', '2020-01-06 12:48:12', '0');
INSERT INTO `sys_api` VALUES ('795', '00000000016', '1', '下机印版原始记录', '907f1beb47', 'SELECT a.[品种],a.[工序],a.[色次],a.[印版类型],a.[印数],a.[机台],a.[印版号],a.[付出方],a.[付出人员],a.[接收方],a.[接收人员],a.[机长],a.[使用状态],convert(varchar,a.[领用时间],120) 领用时间,convert(varchar,a.[归还时间],120) 归还时间,a.[备注] FROM dbo.v_cbpc_plate_using AS a WHERE convert(varchar,归还时间,112) BETWEEN ? AND ? ORDER BY a.[品种] ASC,a.[工序] ASC,a.[领用时间] ASC', 'tstart,tend', '', '2020-01-07 16:10:53', '2020-01-07 16:10:53', '0');
